import { Box, Typography } from "@mui/material";
import { styled } from "@mui/system";
import React, { useEffect, useState } from "react";
import data_borne from "./data_borne.json";

function AppBorneMulhouse1() {
  const [dataBorne, setDataBorne] = useState(data_borne);

  const lBox = styled("Box")(
    {
      display: "flex",
      flexDirection: "column",
      alignItems: "center",
    },
    ({ theme }) => `
  background-color: ${theme.palette.background.paper};
  box-shadow: ${theme.shadows[1]};
  border-radius: ${theme.shape.borderRadius}px;
  padding: ${theme.spacing(2)};
  min-width: 300px;
  display: "flex",
    flexDirection: "column",
          alignItems: "center",
`
  );

  function borneAvailable() {
    let e;
    if (dataBorne.propriety.available === true) {
      e = (
        <Typography variant="h3" sx={{ color: "green" }}>
          Disponible
        </Typography>
      );
    }
    if (dataBorne.propriety.available === false) {
      e = (
        <Typography variant="h3" sx={{ color: "red" }}>
          Indisponible
        </Typography>
      );
    }
    return e;
  }

  return (
    <>
      <lBox>
        <Typography variant="h2">Borne 1 - Mulhouse</Typography>
      </lBox>

      <Box
        sx={{
          display: "flex",
          flexDirection: "column",
          alignItems: "center",
        }}
      >
        {borneAvailable()}
      </Box>
    </>
  );
}

export default AppBorneMulhouse1;
